function formatScramble(num) {
  if (num < 0) {
    return Math.abs(num) + "-";
  } else {
    return num + "+";
  }
}

function flip() {
  if(side=='white'){
    side='black';
    dial='white';
  }
  else{
    side='white';
    dial='black'
  }
  for(let i of document.querySelectorAll(".circle")){
    i.style.backgroundColor = side;
  }
  for(let i of document.querySelectorAll(".dial")){
    i.style.backgroundColor = dial;
  }
  scramble();
}

function scramble() {
  if(side=="white"){
    for(let i=0; i<9; i++){
      document.querySelectorAll(".dial")[i].style.transform = "translate(50px, 2px) rotate("+random[i]*30+"deg)";
      document.querySelectorAll(".twelve")[i].style.transform = "translate(50px,-10px)";
    }
  }
  if(side=="black"){
    for(let i=0; i<5; i++){
      document.querySelectorAll(".center")[i].style.transform = "translate(50px, 2px) rotate("+(random[i+9]+6)*30+"deg)";
    }
    document.querySelector(".dl.dial").style.transform = "translate(50px, 2px) rotate("+(random[0]+6)*-30+"deg)";
    document.querySelector(".dr.dial").style.transform = "translate(50px, 2px) rotate("+(random[2]+6)*-30+"deg)";
    document.querySelector(".ul.dial").style.transform = "translate(50px, 2px) rotate("+(random[6]+6)*-30+"deg)";
    document.querySelector(".ur.dial").style.transform = "translate(50px, 2px) rotate("+(random[8]+6)*-30+"deg)";
    for(let i=0; i<9; i++){
      document.querySelectorAll(".twelve")[i].style.transform = "translate(50px,110px)"
    }
  }
}

function changePinOrder() {
  let input = prompt("enter pin order, for example: dl R DR \\ UL L ur")
  output = checkPinOrder(input)
  if(output != false){
    order = [output[0].split(" "),output[1].split(" "),output[2]];
    document.querySelector("#pinOrder").innerText = output[0]
    const items = output[0].split(' ');
    const container = document.getElementById('pairs');
    container.innerHTML = "select which moves to memo:"
    for (const item of items) {
      const input = document.createElement('input');
      input.type = 'checkbox';
      input.value = item;
      input.id = item;
      const label = document.createElement('label');
      label.htmlFor = item;
      label.innerText = item;
      container.appendChild(input);
      container.appendChild(label);
    }
    alert("pin order changed!");
  }
  else{
    alert("that's not a pin order! please try again.");
  }
}
function checkPinOrder(input) {
  let sortedInput = input.split(" ").slice().sort();
  for(let i of pinOrders){
    let sortedOrder = i.split(" ").slice().sort();
    if(sortedOrder.every((element, index) => element === sortedInput[index])){
      document.querySelector("#udselect").innerHTML = ""
      if(sortedInput.includes("U")){
        document.querySelector("#udselect").innerHTML += 'execute the U move with your: <select id="umove"><option value="left">left hand</option><option value="right">right hand</option></select> '
      }
      if(sortedInput.includes("D")){
        document.querySelector("#udselect").innerHTML += 'execute the D move with your: <select id="dmove"><option value="left">left hand</option><option value="right">right hand</option></select>'
      }
      return [input,i,pinOrders.indexOf(i)];
    }
  }
  return false;
}

